import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import "../assets/managePrograms.css";

const ViewBugs = () => {
  const [bugs, setBugs] = useState([]);
  const [error, setError] = useState("");
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem("user"));

  useEffect(() => {
    fetchBugs();
  }, []);

  const fetchBugs = async () => {
    try {
      const token = localStorage.getItem("token");
      const res = await axios.get("http://localhost:8080/api/bugs", {
        headers: { Authorization: `Bearer ${token}` },
      });

      if (Array.isArray(res.data)) {
        setBugs(res.data);
      } else {
        setBugs([]);
        console.warn("Bug data was not an array");
      }
    } catch (err) {
      console.error("Error fetching bugs:", err);
      setError("Failed to fetch bugs.");
    }
  };

  return (
    <div className="fullscreen-bugs-container" style={{
      maxWidth: "96%",
      margin: "30px auto",
      padding: "30px",
      backgroundColor: "rgba(255, 255, 255, 0.05)",
      borderRadius: "12px",
      boxShadow: "0px 8px 16px rgba(0,0,0,0.25)"
    }}>
      <h2 style={{
        fontSize: "2.4rem",
        textAlign: "center",
        marginBottom: "25px",
        color: "#fff"
      }}>
        Reported Bugs
      </h2>

      {error && <p className="error-message">{error}</p>}

      <div className="fullscreen-table-wrapper" style={{ overflowX: "auto" }}>
        <table className="fullscreen-table" style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th>ID</th>
              <th>Title</th>
              <th>Program</th>
              <th>Area</th>
              <th>Severity</th>
              <th>Priority</th>
              <th>Status</th>
              <th>Resolution</th>
              <th>Reporter</th>
              <th>Assigned To</th>
              <th>Resolved By</th>
              <th>Comments</th>
              <th>Reported On</th>
              {user.level === 3 && <th>Actions</th>}
            </tr>
          </thead>
          <tbody>
            {bugs.length > 0 ? (
              bugs.map((bug) => (
                <tr key={bug.bugId}>
                  <td>{bug.bugId}</td>
                  <td>{bug.title}</td>
                  <td>{bug.program?.name || "—"}</td>
                  <td>{bug.functionalArea?.name || "—"}</td>
                  <td>{bug.severity || "—"}</td>
                  <td>{bug.priority || "—"}</td>
                  <td>{bug.status || "Open"}</td>
                  <td>{bug.resolutionStatus || "—"}</td>
                  <td>{bug.reportedBy?.name || "—"}</td>
                  <td>{bug.assignedTo?.name || "—"}</td>
                  <td>{bug.resolvedBy?.name || "—"}</td>
                  <td>{bug.comments || "—"}</td>
                  <td>{bug.dateReported?.slice(0, 10) || "N/A"}</td>
                  {user.level === 3 && (
                    <td>
                      <button
                        onClick={() =>
                          navigate(`/edit-bug/${bug.bugId}`, { state: { bug } })
                        }
                        style={{
                          padding: "8px 14px",
                          background: "#007bff",
                          color: "white",
                          border: "none",
                          borderRadius: "5px",
                          cursor: "pointer"
                        }}
                      >
                        Edit
                      </button>
                    </td>
                  )}
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="14" style={{ textAlign: "center", padding: "20px" }}>
                  No bugs found.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ViewBugs;
